column8:
ラッピングやヘアアクセサリー、スクラップブッキングやデコレーションなど、用途も多様♪<br>
シャリシャリとした手触りで、結びやすいリボンです！<br>
しかも、5m巻なのにお買い得プライス！たっぷりお使いいただけて、<br>
ゴージャスにアレンジしていただけます。<br>
<br>
◆素材：ポリエステル/51％、ポリプロピレン/47％、ナイロン/2％<br>
◆サイズ：幅約6mm×5ｍ巻<br>
<br>
※見本画像と現物の色が多少異なる場合がございます。<style type="text/css">
<!--

body {


background-color:#fff;

/* フォント指定 */
font-family:メイリオ,Meiryo,ヒラギノ角ゴ Pro W3,Hiragino Kaku Gothic Pro,ＭＳ Ｐゴシック,MS PGothic,Osaka,sans-serif;
}

/* 個数入力欄の大きさ */
input#units {
padding: 1px 0px;
}

/* 「納期情報」欄の指定*/
td.inventory font{font-size:10px;color:#666666;}
td.inventory{word-wrap:break-word;width:80px;}

/*「買い物かごに入れる」ボタン上に画像を表示 */
span.unit { background: url(http://image.rakuten.co.jp/yuzawaya-2/cabinet/top/information-pc.jpg) no-repeat left top; text-indent:
-9999; display: block; width: 350; height: 70; margin:10px 0; }

/*「買い物かごに入れる」ボタンの大きさ(1ページ複数商品の場合のみ適用) */
td > input{
font-size: 15px;
padding:20px 50px;
width: auto;
}

/* 商品名下に境界線が入る */
span.item_name {
    display: block;
    border-bottom: 2px dotted #ddd;
    padding-bottom: 8px;
}

/* 価格に枠線がつく */
table#rakutenLimitedId_cart {
    background-color: #f8f8f8;
    border: 1px solid #ddd;
    padding: 8px;
    margin: 16px 0;
}

span.price1 {
    color: #333 !important;
    font-weight: bold;
    font-size: 80% !important;
    line-height: 30px;
    display: inline-block;
    margin-right: 16px;
}

/* カテゴリページの価格表示 */
span.category_itemtaxpostage {font-size:10px;} /* 送料・税込の非表示 */
span.category_itemprice {color:#e60033;font-size:20px;font-weight:bold; display:block;} /* 価格 */
table{z-index:0;} 
span.shippingCost_free {font-size:14px;display:block;} /* 送料無料 */

-->
</style>

