ふんわり感や透け感、上品なキラキラ感にこだわった素材を1枚のカードに。<br>
ふわふわ×くしゅくしゅでかわいい布アクセサリーを作りませんか。<br>
簡単なレシピをパッケージに掲載。
<br><br>
製法が違う3種のレース。<br>
コードタイプのトーションレースは柔らかい落ち感でラリエットにぴったり。
<br><br>
◆テープの種類：トーションレース1m、ケミカルレース10cm、ラッセルレース1m<br>
◆パッケージサイズ：17×6.7cm
